function onLoad() {
    this.bird = this.getMorphNamed('bird')
    this.groundY = 384-this.bird.getExtent().y
    this.reset()
    this.initSpeed = -9.8;
    this.curSpeed = 0;
    this.g = 0.98
    this.x = this.getExtent().x
    this.y = this.getExtent().y-112
    this.tubeDown = lively.PartsBin.getPart('tubeDown', 'PartsBin/MDM')
    this.tubeUp = lively.PartsBin.getPart('tubeUp', 'PartsBin/MDM')
    this.pipes=[]
}

152.source:
function reset() {
    this.gameState = 0;
    Global.clearInterval(this.birdInterval)
    Global.clearInterval(this.addPipeInterval)
    Global.clearInterval(this.movePipesInterval)
    this.removePipes()
    this.bird.setPosition(pt(150,this.getExtent().y/2-this.bird.getExtent().y/2))
    var instr = lively.PartsBin.getPart('Text', 'PartsBin/Basic')
    instr.setName('instr')
    instr.setTextString('press "t" to start');
    instr.setExtent(pt(140,30))
    instr.setInputAllowed(false)
    this.instr =  this.getMorphNamed('instr')==null?this.addMorph(instr):this.instr
    this.instr.setPosition(pt(400,100))
}

155.source:
function flap() {
    var self = this
    var cPos = this.bird.getPosition()
    if(this.bird.getPosition().y>=this.groundY)
        this.reset()
    else if(this.hitPipes())
        this.reset()
    else {
        this.curSpeed += this.g;
        this.bird.setPosition(pt(cPos.x,Math.max(cPos.y + this.curSpeed,0)))
    }
}

